style.css:
@-moz-document domain("discord.com") {
/* Ustawienie tła */
  body::before {
    content: "";
    background: url('https://i.imgur.com/IThPmGN.jpg') no-repeat center center fixed;
    background-size: cover;
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    z-index: -1;
  }

  /* Kolory tekstu i elementów */
  .theme-dark {
    --background-primary: rgba(0, 0, 0, 0.3); /* bardziej przezroczyste tło */
    --background-secondary: rgba(0, 0, 0, 0.2); /* bardziej przezroczyste tło */
    --background-tertiary: rgba(0, 0, 0, 0.1); /* bardziej przezroczyste tło */
    --channeltextarea-background: rgba(0, 0, 0, 0.1); /* bardziej przezroczyste tło */
    --background-accent: #6BAE75; /* pasujący do zieleni */
    --background-floating: rgba(0, 0, 0, 0.3); /* bardziej przezroczyste tło */
    --text-normal: #D0E7DB; /* pasujący jasny kolor tekstu */
    --text-muted: #B0C4B1; /* pasujący przytłumiony kolor tekstu */
    --text-link: #A0D6B4; /* pasujący kolor linków */
    --scrollbar-thin-thumb: #5B8E7E; /* pasujący kolor suwaka */
  }
}
